import {useNavigate} from 'react-router-dom'

export const Intro =()=>{

    const navigate = useNavigate()

setTimeout(() => {
    navigate('/login'); 
}, 5000);  

    return(

    <div> <img style={{justifyContent:'center', width:'800px', height:'auto'}} src={require('../../../../img/marvel-logo.gif')} alt="loading..."/></div>
    )
}
